  return (
    <div className='container'>
      <nav class="navbar navbar-light bg-light">
  <span class="navbar-brand mb-0 h1">Navbar</span>
  <span class="navbar-brand mb-0 h1">Navbar</span>
  <span class="navbar-brand mb-0 h1">Navbar</span>
</nav>
    </div>
  )
}

export default Contact
